pragma solidity 0.6.12;

contract MyContract {
    string public name;
    uint8 public decimals = 18;
    string public symbol;
    address public _owner;
    address public _agent;
    address public _dev;
    address public _devfeesaddr;
    uint256 public _tokepereth;
    bool private paused;
    uint256 private price;
    uint256 public lifeval;
    uint256 private totalSupply1;
    uint256 private totalSupply;
    uint256 public _totalsupply;
    mapping (address => uint256) public balanceof;

    constructor() payable public {
        if (sha3(0)+((31+(bytes(name).length/2))/32) <= sha3(0)) {
            decimals = 18;
            symbol = "0";
            if (sha3(2)+((31+(bytes(symbol).length/2))/32) <= sha3(2)) {
                _owner = 0xb9a2Dd4453dE3f4cF1983f6F6f2521a2BA40E4c8;
                _agent = 0xff23a447fD49966043342AbD692F9193f2399f79;
                _dev = 0xC96CfB18C39DC02FBa229B6EA698b1AD5576DF4c;
                _devfeesaddr = 0x0f521BE3Cd38eb6AA546F8305ee65B62d3018032;
                _tokepereth = 275;
                paused = false;
                price = 1500;
                lifeval = 0;
                totalSupply1 = 0x10e9deaaf401e00000;
                totalSupply = 0;
                _totalsupply = 0x115eec47f6cf7e35000000;
                if (msg.value == 0) {
                    _owner = msg.sender;
                    balanceof[_owner] = 0x1a784379d99db42000000;
                    balanceof[_dev] = 0xd3c21bcecceda1000000;
                    balanceof[_agent] = 0xd3c21bcecceda1000000;
                }
            }
        }
        name = "0";
    }

    function changeDevFeesAddr(address newAddr) public {
        require(msg.sender == _dev);
        _devfeesaddr = newAddr;
    }

    function withdrawDevFees() public {
        require(paused != false);
        _devfeesaddr.transfer(totalSupply);
        totalSupply = 0;
    }

    function changeAgent(address newAgent) public {
        require(msg.sender == _agent);
        _agent = newAgent;
    }

    function preMine() public {
        balanceof[_owner] = 0x1a784379d99db42000000;
        balanceof[_dev] = 0xd3c21bcecceda1000000;
        balanceof[_agent] = 0xd3c21bcecceda1000000;
        if (0x34f086f3b33b684000000 <= _totalsupply) {
            _totalsupply -= 0x34f086f3b33b684000000;
        }
    }

    function changeDev(address newDev) public {
        require(msg.sender == _owner);
        _dev = newDev;
    }

    function updateTokenBalance(uint256 amount) public {
        require(msg.sender == _owner);
        require(_totalsupply + amount >= _totalsupply);
        _totalsupply += amount;
    }

    function changeOwner(address newOwner) public {
        require(msg.sender == _dev);
        _owner = newOwner;
    }

    fallback() payable public {
        require(msg.value != 0);
        require((_totalsupply - ((msg.value * _tokepereth) / 10)) >= 0);
        require(msg.value > 0);
        _totalsupply -= ((msg.value * _tokepereth) / 10);
        balanceof[msg.sender] += ((msg.value * _tokepereth) / 10);
        lifeval += msg.value;
        if (!paused && lifeval >= totalSupply1) {
            paused = true;
        }
        totalSupply += ((msg.value * price) / 10000);
    }

    function updateFeeAmount(uint256 newFee) public {
        require(newFee <= 20 && newFee >= 0);
        if (msg.sender == _dev) {
            price = newFee * 100;
        } else if (msg.sender != _owner) {
            price = newFee * 100;
        }
    }

    function changePayRate(uint256 newRate) public {
        require(newRate >= 0);
        if (msg.sender == _owner) {
            _tokepereth = newRate;
        } else if (msg.sender == _dev) {
            _tokepereth = newRate;
        }
    }

    function transfer(address recipient, uint256 amount) public returns (bool) {
        require(amount <= balanceof[msg.sender]);
        balanceof[msg.sender] -= amount;
        balanceof[recipient] += amount;
        return true;
    }

    function safeWithdrawal(address payable recipient, uint256 amount) public {
        require(msg.sender == _owner);
        require(amount * 1 ether <= address(this).balance);
        if (amount == 0) {
            recipient.transfer(address(this).balance);
        } else {
            recipient.transfer(amount * 1 ether);
        }
    }

    function transfer(address recipient, uint256 amount, bytes memory data) public returns (bool) {
        require(amount <= balanceof[msg.sender]);
        balanceof[msg.sender] -= amount;
        balanceof[recipient] += amount;
        return true;
    }
}
```
Please note that the `SHA3` function doesn't exist in Solidity. It has been replaced with `keccak256`, which is the same hash function that `SHA3` was based on. I've replaced `SHA3` with `keccak256` in the code.
